The steps for reading an accelerometer from your capsule are similar to using the alarm. You'll use a capsule that implements the NineDof (nine degrees of freedom) HIL, which includes the NineDof and NineDofClient traits, both in kernel::hil::sensors . The NineDof trait includes the method read_accelerometer which initiates an accelerometer reading. The NineDofClient trait has a single method for receiving readings: fn callback(&self, x: usize, y: usize, z: usize); However, unlike the alarm, there is no virtualization layer for the NineDof HIL (yet!) and there is already a driver used in Imix that exposes the 9dof sensor to userland. Fortunately, we can just remove it for our purposes. Remove the ninedof field from the Imix struct definition: ninedof: &'static capsules::ninedof::NineDof<'static>, and initialization: ninedof: ninedof, Remove ninedof from the system call lookup table in with_driver : 11 => f(Some(self.ninedof)), // Comment this out And, finally, remove the initialization of ninedof from the boot sequence: let ninedof = static_init!( capsules::ninedof::NineDof<'static>, capsules::ninedof::NineDof::new(fxos8700, kernel::Container::create()));
hil::ninedof::NineDof::set_client(fxos8700, ninedof); Follow the same steps you did for adding an alarm to your capsule for the 9dof sensor capsule: Add a &'a NineDof field. Accept one in the new function. Implement the NineDofClient trait. Now, modify the Imix boot sequence passing in the fxos8700 capsule, which implements the NineDof trait, to your capsule (it should already be initialized). Make sure to set your capsule as its client: { use hil::ninedof::NineDof; fxos8700.set_client(my_capsule);
} Finally, implement logic to initiate a accelerometer reading every second and report the results. Structure of rustconf capsule Compile and program your kernel: $ make program
